import React, { Fragment } from 'react';
import Image from "react-bootstrap/Image";

import background from '../../../public/wooden-texture.jpg' 

const Home = () => {
    return ( 
        <Fragment class>
            <Image src={background} fluid /> 
            <h1>Este es el Home</h1>
        </Fragment>
     );
}

export default Home;
